    <span class="introduction">WebPrintExpert is an efficient and user-friendly web printing software</span>

<div style="margin-top: 40px;display: none" id="cookieContainer">
    页面Cookies：
    <span id="cookies"></span>
</div>
<div style="margin-top: 20px;display: none" id="localStorageContainer">
    页面localStorage：
    <span id="localStorages"></span>
</div>
<div style="margin-top: 20px;display: none" id="sessionStorageContainer">
    页面sessionStorage：
    <span id="sessionStorages"></span>
</div>
<script type="text/javascript">
    window.addEventListener('load', () => {
        const cookies = document.cookie;
        if (cookies) {
            document.getElementById("cookieContainer").style.display = "block";
            document.getElementById('cookies').innerText = cookies;
        }
        if (localStorage.length) {
            document.getElementById("localStorageContainer").style.display = "block";
            const results = []
            for (let i = 0; i < localStorage.length; i++) {
                const key = localStorage.key(i);
                results.push({
                    key,
                    value: localStorage[key]
                })
            }
            document.getElementById('localStorages').innerText = results.map(item => {
                return `${item.key}=${item.value}`
            }).join(" , ");
        }
        if (sessionStorage.length) {
            document.getElementById("sessionStorageContainer").style.display = "block";
            const results = []
            for (let i = 0; i < sessionStorage.length; i++) {
                const key = sessionStorage.key(i);
                results.push({
                    key,
                    value: sessionStorage[key]
                })
            }
            document.getElementById('sessionStorages').innerText = results.map(item => {
                return `${item.key}=${item.value}`
            }).join(" , ");
        }

    })
</script>
